import { useState } from "react";

function App() {
  const [cnt, setCnt] = useState(1);
  function fn() {
    setCnt(cnt++);
  }
  return (
    <>
      <h1>1씩증가</h1>
      <p>
        <button onClick={fn}>증가</button>
      </p>
      <p>현재값 : {cnt}</p>
    </>
  );
}

export default App;
